import '../assets/css/OrbitCarousel.css';

export default function OrbitCarousel() {
  return (
    <div className="carousel-container">
        <div className="orbit">
            <div className="item item1"/>
            <div className="item item2"/>
            <div className="item item3"/>
        </div>
    </div>
  );
}
